import React from 'react';
import Spline from '@splinetool/react-spline';

export default function Home() {
  return (
    <div style={{ position: 'relative', height: '100vh', width: '100vw', overflow: 'hidden' }}>
      {/* Spline scene covering the full screen */}
      <Spline
        scene="https://prod.spline.design/3z9PPkKZWxSG4JeS/scene.splinecode"
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100%',
          height: '100%',
          objectFit: 'cover', // Ensures the scene stretches to cover the entire area
        }}
      />

      {/* Text centered on top of the scene */}
      <h1
        style={{
          position: 'absolute',
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)', // Perfectly centers the text
          color: '#fff', // White color for better contrast
          fontSize: '3rem', // Large font size to make the text more prominent
          fontWeight: 'bold', // Bold text
          zIndex: 1, // Ensures the text is on top of the scene
        }}
      >
        Welcome to UniFix!
      </h1>
    </div>
  );
}
